import React from "react";
import {futsalGame, basketGame, footyGame, soccerGame, volleyGame} from "./img/export";

class Sports extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return(
            <div>
            <div className="flex pa4 ma4">
                <img alt='fut' src={basketGame}/>
                <p className="f8">Basketball, colloquially referred to as hoops,[1] is a team sport in which two teams, most commonly of five players each, opposing one another on a rectangular court, compete with the primary objective of shooting a basketball (approximately 9.4 inches (24 cm) in diameter) through the defender's hoop (a basket 18 inches (46 cm) in diameter mounted 10 feet (3.048 m) high to a backboard at each end of the court) while preventing the opposing team from shooting through their own hoop</p>

            </div>
        <div className="flex pa6">
            <img alt='fut1' src={footyGame}/>
            <p className="f8">Basketball, colloquially referred to as hoops,[1] is a team sport in which two teams, most commonly of five players each, opposing one another on a rectangular court, compete with the primary objective of shooting a basketball (approximately 9.4 inches (24 cm) in diameter) through the defender's hoop (a basket 18 inches (46 cm) in diameter mounted 10 feet (3.048 m) high to a backboard at each end of the court) while preventing the opposing team from shooting through their own hoop</p>

        </div>
            </div>
        );
    }
    }
    export default Sports;
